func TestCreate(t *testing.T) {
	var f FID
	var err error
	if f, err = Create("testCreate"); err != nil {
		t.Error(err)
	} else {
		if err = Close(f); err != nil {
			t.Error(err)
		}
	}
}

func TestDelete(t *testing.T) {
	if err := Delete("testCreate"); err != nil {
		t.Error(err)
	}
}

func TestOpen(t *testing.T) {
	var createFid, _ = Create("testOpen")
	Close(createFid)

	var f FID
	var err error
	if f, err = Open("testOpen"); err != nil {
		t.Error(err)
	} else {
		if err = Close(f); err != nil {
			t.Error(err)
		}
	}

	Delete("testOpen")
}

