func TestWrite(t *testing.T) {
	var fid, _ = Create("testWrite")

	if err := Write(fid, 0, &block0); err != nil {
		t.Error(err)
	}

	if err := Write(fid, 1, &block1); err != nil {
		t.Error(err)
	}

	if err := Write(fid, 2, &block2); err != nil {
		t.Error(err)
	}

	Close(fid)
}

func TestRead(t *testing.T) {
	var fid, _ = Open("testWrite")

	if block0read, err := Read(fid, 0); err == nil {
		if blocksEqual(&block0, block0read) == false {
			t.Error("Block0NotEqual")
		}
	} else {
		t.Error(err)
	}

	if block1read, err := Read(fid, 1); err == nil {
		if blocksEqual(&block1, block1read) == false {
			t.Error("Block1NotEqual")
		}
	} else {
		t.Error(err)
	}

	if block2read, err := Read(fid, 2); err == nil {
		if blocksEqual(&block2, block2read) == false {
			t.Error("Block2NotEqual")
		}
	} else {
		t.Error(err)
	}

	Close(fid)
}

func TestLength(t *testing.T) {
	var fid, _ = Open("testWrite")
	var length, err = Length(fid)

	if err != nil {
		t.Error(err)
	}

	if length != 3 {
		t.Error("WrongFileLength")
	}

	Close(fid)
}

func TestLS(t *testing.T) {
	var files = ls()

	if !contains(files, "testWrite") {
		t.Error("TestfileNotInLS")
	}

	Delete("testWrite")
}

/* ---------------- helper functions ---------------- */

func blocksEqual(a *Block, b *Block) bool {
	for i, v := range *a {
		if v != b[i] {
			return false
		}
	}
	return true
}

func contains(array []string, element string) bool {
	for _, cur := range array {
		if cur == element {
			return true
		}
	}
	return false
}
